import './App.css';
//import PrimButton from './Components/Button'
import {  BrowserRouter as Router ,Switch, Route} from "react-router-dom";
import { Link } from "react-router-dom";

import LoginPage from './Views/LoginPage'
import MemberRegistration from './Views/MemberRegistration'
import SignUpPage from './Views/SignUpPage'

import { List as LS, ListItem } from '@material-ui/core';
import PrimButton from './Components/Button';




function App() {
  return (
    <div className="App">
  <Router>


    <PrimButton message="HOE" onClick={()=>{window.location.href = "/MemberRegistration"}}/>


    <Switch>  
      <Route exact path = "/" >
          <LoginPage/>             
      </Route>

      <Route exact path = "/SignUpPages">
          <SignUpPage/>
      </Route>

      <Route exact path = "/MemberRegistration" >
          <MemberRegistration/>
      </Route>

    </Switch>
   </Router>

    </div>
  );
}

export default App;
